import { Component, h } from '@stencil/core';
import '@stencil/router';
import { routes } from './routes';
export class App {
    render() {
        return (h("stencil-router", null,
            h("stencil-route-switch", { scrollTopOffset: 0 }, routes.map(r => (h("stencil-route", { url: r.url, component: r.component, exact: true }))))));
    }
    static get is() { return "sc-app"; }
}
